import React, { useState } from "react";
import "./qualification.css";

const Qualification = () => {
  const [toggleState, setToggleState] = useState(1);

  const education = {
    "San Jose State University": ["San Jose, CA", "B.S. Software Engineering, Minor Mathematics", "GPA 3.5/4.0", "08/2018 - 05/2021"],
    "Green River Community College,": ["Auburn, WA", "A.S. Computer Science", "GPA 3.9/4.0", "08/017 - 08/2018"],
    "Green River ,": ["Auburn, WA", "A.S. Computer Science", "GPA 3.9/4.0", "08/017 - 08/2018"]
  };
  const keyValuePairsEdu = Object.entries(education);
  return (
    <section className="qualification section">
      <h2 className="section__title">Qualification</h2>
      <span className="section__subtitle">My personel journey</span>

      <div className="qualification__container container">
        <div className="qualification__tabs">
          <div
            className={toggleState === 1 ? "qualification__button qualification__active button--flex": "qualification__button button--flex"}
            onClick={() => setToggleState(1)}>
            <i className="uil uil-graduation-cap qualification__icon"></i>
            Education
          </div>

          <div className={toggleState === 2? "qualification__button qualification__active button--flex": "qualification__button button--flex"}
               onClick={() => setToggleState(2)}>
            <i className="uil uil-briefcase-alt qualification__icon"></i>
            Experience
          </div>
        </div>

        <div className="qualification__sections">
          <div className={toggleState === 1? "qualification__content qualification__content-active": "qualification__content"}>

            {keyValuePairsEdu.map(([key, value])=> (
               <div>
                    <div className="qualification__data">
                        <div></div>
{/*                       <div> */}
{/*                         <span className="qualification__rounder"></span> */}
{/*                         <span className="qualification__line"></span> */}
{/*                       </div> */}

                      <div>
                        <h3 className="qualification__title">{key}</h3>
                        <span className="qualification__subtitle">{value[0]}</span>
                        <div className="qualification__subtitle">{value[1]}</div>
                        <div className="qualification__subtitle">{value[2]}</div>
                        <div className="qualification__calender">
                          <i className="uil uil-calendar-alt"></i>{value[3]}
                        </div>
                      </div>


                         <div>
                           <span className="qualification__rounder"></span>
                           <span className="qualification__line"></span>
                         </div>


                    </div>
                </div>
            ))}




          </div>

          <div className={toggleState === 2? "qualification__content qualification__content-active": "qualification__content"}>

          </div>
        </div>
      </div>
    </section>
  );
};

export default Qualification;
